import datepicker from 'js-datepicker'


function UserComponent(props){

    const [events, setEvents] = useState([]);
    //var picker = new AppointmentPicker(document.getElementById('time'), {});
    var picker = new datepicker(document.getElementById('time'));

    return(
        <div>
            <NavBarComponent/>
            <div className="user-page">
                <div className="sideBar">
                    <input id="time" type="text" value="10:00"/>
                    <button className="appointment-button" onClick={props.handleClick}>Add Appointment</button>
                        <div className="info-box">
                            <h2>Izzeddine Bouzid</h2> <br/>
                            <img src={izzyFace} className="facePic"/>
                            <label>email: ibouzid@emich.edu</label><br/>
                            <label>Status: Senior</label><br/>

                        </div>

                        <div className="info-box">
                            <h2>Courses</h2>
                            <label>COMP SCI 441</label><br/>
                            <label>MATH 220</label><br/>
                        </div>
                </div>

                <div className="calendar">
                    <CalendarComponent
                        events={events}
                    />

                </div>
            </div>




        </div>
    )
}

export default UserComponent
